import { data } from "./Data/TodoListData"
import Task from "./Task";
import './Note.css';

function Note() {
    console.log(data[0])
    console.log(data[0].date)
    const task = {
        overflowY: 'auto', /* Add vertical scroll if content exceeds height */
        maxHeight: '209px', /* Set a maximum height for the container */
    }
    return (
        <>
            <div className="note-container ">


                <div>
                    <div style={task}>
                        <Task />
                    </div>

                    <div className="agent" > 
                        Agent 
                    </div>

                </div>

                <div className="analysis" >
                    <div>
                        <p> analysis here </p>
                    </div>
                </div>

            </div>

        </>
    );
}

export default Note;
